class Solution(object):
    def total_count(self, n):
        mid = n//2
        if n%2 == 0:
            count = (n+1) * mid
        else:
            count = n * (mid+1)
        return count

    def countHomogenous(self, s):
        total = 0
        count = 0
        curr_char = s[0]

        for i in range(1, len(s)):
            count += 1
            if s[i] != curr_char:
                total += self.total_count(count)
                count = 0
            curr_char = s[i]
        
        return total + self.total_count(count+1)

sol = Solution()
# s = "abbcccaa"
s = 'zzzzz'
s = ""
print(sol.countHomogenous(s))